import React from 'react'
import "./Login.css"

function Login() {
  return (
    <div>
     <img
     className="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a9/Amazon_logo.svg/1024px-Amazon_logo.svg.png"
     />
    </div>
  )
}

export default Login
